import './App.css';
import Footer from './Footer';
import Header from './Header';
import Home from './Home';

function App() {
  return (
    <>
    <div className='flex flex-col justify-between w-screen bg-slate-200'>
      <Header></Header>
      <Home></Home>
      <About></About>
      <Footer></Footer>
    </div>
    </>
  );
}

export default App;
